import axios from "axios";
import React, { useEffect, useState } from "react";

const App = () => {
  const [products, setProducts] = useState([]);
  useEffect(() => {
    axios
      .get("https://fakestoreapi.com/products")
      .then((response) => {
        setProducts(response.data);
      })
      .catch((error) => alert(error.message));
  }, []);
  return <div>App</div>;
};

export default App;
